export default function App() {
  return (
    <div className="tips">
      <BillInput />
      <SelectPercentage />
      <Reset />
    </div>
  );
}

function BillInput() {
  return (
    <div>
      How much was the bill?
      <input type="text" />
    </div>
  );
}

function SelectPercentage() {
  return (
    <div>
      How did you like the service?
      <select>
        <option>It was good (10%)</option>
      </select>
    </div>
  );
}

function Reset() {}
